import React from 'react';
import Header from '../components/header';
import UserForm from '../components/form';
import Buttonbrn from '../components/button';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Login = () => {
  return (
    <>        
        <Header title={"Login"} curPage={"Login"}/>
        <Container className='login-container'>
          <Row>
            <Col lg={4}>
                 
            </Col>
            <Col className='login-form' lg={4}>
              <div className='image' id="loginlogo">
                <img src="/images/logolong.png?raw=true" alt="Company logo" className='rounded' id='loginlogo'/>
              </div>            
              <UserForm/>            
              <div className='buttons-area'>
                <div className='row' id='btn-row2'>
                  <div className='left col-lg-6'>
                    <Buttonbrn title={"Forgot password"}/>
                  </div>
                  <div className='right col-lg-6'>
                    <Buttonbrn title={"Privacy policy"}/>
                  </div>
                </div>
              </div>
            </Col>
            <Col lg={4}>
              
            </Col>
          </Row>
        </Container>             
    </>
  );
}
export default Login
